var ko = require('knockout');
require('./libs/ko.files.js');

var INITIAL_DATA = 'data:image/jpeg;base64,';

function getImageDataColumn(image, columnNumber) {
	var returnArray = [];

	for (var y = 0; y < image.height; ++y) {
		for (var x = 0; x < image.width; ++x) {
			if (x === columnNumber) {
				var i = (y * image.width + x) * 4;
				var s = 'rgb(' + image.data[i] + ',' + image.data[++i] + ',' + image.data[++i] + ')';
				returnArray.push(s);
			}
		}
	}
	return returnArray;
}

function model(initialImageData) {
	var self = this;

	self.divisor = ko.observable(1);
	self.currentLine = ko.observable(0);
	self.lineMax = ko.observable(1);
	self.imageDataUrl = ko.observable(false);
	self.imageData = ko.observable(false);
	self.columnColors = ko.computed(function() {
		return getImageDataColumn(self.imageData(), parseInt(self.currentLine(), 10));
	});
	self.filteredColumnColors = ko.computed(function() {
		return self.columnColors().filter((function(color, i){
        	return i % self.divisor() === 0;
        }));
	});
	self.markerPosition = ko.computed(function() {
		return parseInt(self.currentLine(), 10) / parseInt(self.lineMax(), 10) * 100 +'%';
	});
	self.fullGradientString = ko.computed(function() {
        return 'background: linear-gradient(to right, ' + self.columnColors().join(',') + ');';
    });
	self.gradientString = ko.computed(function() {
        return 'background: linear-gradient(to right, ' + self.filteredColumnColors().join(',') + ');';
    });

	self.fileLoaded = function(file, data) {
        var canvas = document.createElement('canvas');
        var context = canvas.getContext('2d');
        var imageObj = new Image();

        imageObj.onload = function() {
        	canvas.width = imageObj.width;
        	canvas.height = imageObj.height;
			context.drawImage(imageObj, 0, 0);

			var imageData = context.getImageData(0, 0, canvas.width, canvas.height);
			self.lineMax(parseInt(imageObj.height / 2, 10));
			self.imageData(imageData);
        };

        imageObj.src = data;
        self.imageDataUrl(data);
	};

	self.showCSS = ko.observable(false);
	self.toggleCSS = function() {
		self.showCSS(!self.showCSS());
	};

	// Init
	self.fileLoaded(null, initialImageData);
};

ko.applyBindings(new model(INITIAL_DATA));
